script: |
  super -f text -I q5723.spq | sort > q5723.out

inputs:
  - name: q5723.spq
    data: |
      SELECT col1 * + ( col2 ) FROM tab1 (FORMAT parquet) cor0 WHERE col0 BETWEEN + col2 * + - col2 * - col0 + col0 AND + - col0 - - + col2 + - col2 * + CAST ( + col0 AS INTEGER ) / - - 49;
  - name: tab1

outputs:
  - name: q5723.out
    data: |
